  `idparquesNacionales` INT NOT NULL AUTO_INCREMENT,
  `nomParque` VARCHAR(50) NOT NULL,
  `recomendaciones` VARCHAR(3) NOT NULL,
  `idParroquia` INT NOT NULL,
  PRIMARY KEY (`idparquesNacionales`),
  INDEX ` idParroquias_idx` (`idParroquia` ASC) VISIBLE,
  CONSTRAINT ` idParroquia`
    FOREIGN KEY (`idParroquia`)
    REFERENCES `practicagrupal`.`Parroquias` (`idParroquia`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

