-- Table `practicagrupal`.`Comerciales`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `practicagrupal`.`comerciales` (
  `idComercial` INT NOT NULL AUTO_INCREMENT,
  `nombreComercial` VARCHAR(45) NOT NULL,
  `direccion` VARCHAR(45) NOT NULL,
  `referenciaDireccion` VARCHAR(45) NOT NULL,
  `direccionWeb` VARCHAR(45) NOT NULL,
  `email` VARCHAR(45) NOT NULL,
  `telfPrincipal` VARCHAR(45) NOT NULL,
  `telfSecundario` VARCHAR(45) NULL,
  `idParroquia` INT NOT NULL,
  `idCategoria` INT NOT NULL,
  PRIMARY KEY (`idComercial`),
  UNIQUE INDEX `email_UNIQUE` (`email` ASC) VISIBLE,
  INDEX `idParroquias_idx` (`idParroquia` ASC) VISIBLE,
  INDEX `idCategorias_idx` (`idCategoria` ASC) VISIBLE,
  CONSTRAINT `idParroquia_fk`
    FOREIGN KEY (`idParroquia`)
    REFERENCES `practicagrupal`.`Parroquias` (`idParroquia`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `idCategoria_fk`
    FOREIGN KEY (`idCategoria`)
    REFERENCES `practicagrupal`.`Categorias` (`idCategoria`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;



